import styled from './RandomUserContainer.module.css';

const Container = styled.div`
	position: relative;
	display: flex;
	align-items: center;
	justify-content: center;
	width: 50%;
	height: 70%;
	background-color: rgb(242, 239, 239);
	border-radius: 10px;
`;

const RandomUserContainer = ({ children }) => {
	return <div className={styled['user-container']}>{children}</div>;
};

export default RandomUserContainer;
